import React from "react";

import styles from "./Job.module.css";

const Job = () => {
  return (
    <div>
      <h3 className={styles.date}>May 2023 - August 2023</h3>
      <h1 className={styles.title}>Software Engineer Intern</h1>
      <h2 className={styles.employer}>Salesforce &#x2022; San Francisco, CA</h2>
      <p className={styles.description}>
        During my internship, I enhanced the Out of Office feature of a web
        application using Hacklang and React, significantly improving its
        reliability and user interface, which included reducing visual clutter
        by 25%. My contributions led to a 20% increase in user engagement and a
        30% reduction in page load time.
      </p>
    </div>
  );
};

export default Job;
